Mika ”Immu” Ilmen on vanha tuttu vapaaotteluajoilta. Tuolloin piirit oli pienet ja porukka tiivis. 

Monien mutkien saattelemana, Immu päätyi vankilaan, josta vapautui suoritettuaan tuomionsa vuonna 2018. Vapauduttuaan Immu tapasi tutun, joka ehdotti kirjan kirjoittamista. Nyt muutamaa vuotta myöhemmin, kirjoja on ilmeistynyt kaksi ja kolmas on jo tulilla. Lisäksi mies tekee suosittua "Rosvo ja Poliisi" Podcastia, yhdessä entisen vastapelurin Kalevi Puonnin kanssa.

Voisi jopa luonnehtia, että mies on tehnyt täys käännöksen ja elämä on kääntynyt uusille raiteille. 

